			<div class='review'><div class='review-title content-editable'>Funktioniert einwandfrei mit beiden Anschlüssen gleichzeitig</div><div class='review-text content-editable'>Als ich die teilweise ambivalenten Bewertungen zur Funktionalität beider Anschlüsse für eine gleichzeitige Verwendung des Kabels las, war ich natürlich überaus gespannt, ob das Kabel bei mir vollständig funktioniert.Ich besitze ein Huawei P30 Pro und muss sagen, dass das Adapterkabel bei mir einwandfrei funktioniert. Zuerst probierte ich den AUX Adapter mit Kopfhörern aus, dann steckte ich das Ladekabel dazu. Bei gleichzeitiger Nutzung funktioniert das Hören von Musik sowie das gleichzeitige Laden des Handys. Nun lädt es zwar nicht im Speedtempo, allerdings finde ich dies auch unnötig.Ich nutze den AUX Adapter, um Musik in meinen Zumbakursen in einem großen Kursraum abspielen zu können und ich muss sagen, dass ich einen schönen, vollen und guten Klang habe. Kein Sound geht auch in einem großen Raum verloren. Es gibt kein Rauschen und nichts Negatives, das zu bemängeln wäre.Ich bin sehr zufrieden mit dem Kabel!</div><div class='review-stars'><svg class='nc-icon glyph icon-star '  xmlns='http://www.w3.org/2000/svg' xmlns:xlink='http://www.w3.org/1999/xlink' x='0px' y='0px' width='16px' height='16px' viewBox='0 0 16 16'><g>
